import { findModuleChild } from '../webpack';
export const ControlsList = findModuleChild((m) => {
    if (typeof m !== 'object')
        return;
    for (const prop in m) {
        if (m[prop]?.toString && m[prop].toString().includes('().ControlsListChild') && m[prop].toString().includes('().ControlsListOuterPanel')) {
            return m[prop];
        }
    }
    return;
});
